import React from 'react';

import { Container } from './styles';

import logoImg from '../../assets/logo.svg';

const Dashboard: React.FC = () => (
    <Container>
        <Header>
            <HeaderContent>
                <img src={logoImg} alt="GoBarber"/>

                <Profile>
                    <img src="https://avatars2.githubusercontent.com/u/2254731?s=400&u=0ba16a79456c2f250e7579cb388fa18c5c2d7d65&v=4" alt="Diegfo"/>

                    <div>

                    </div>
                </Profile>
            </HeaderContent>
        </Header>
    </ Container>
)

export default Dashboard;
